import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from "./navigation_bar/Home.js"
import About from "./navigation_bar/About"
import Projects from "./navigation_bar/Projects"
import Resume from "./navigation_bar/Resume"
import Skills from "./navigation_bar/Skills"
import Navigation from './navigation_bar/Navigation.js';



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
    <App/>
    <Routes>
      <Route path='/home' element={<Home/>}/>
      <Route path='/about' element={<About/>}/>
      <Route path='/projects' element={<Projects/>}/>
      <Route path='/resume' element={<Resume/>}/>
      <Route path='/skills' element={<Skills/>}/>
    </Routes>
    </BrowserRouter>
  </React.StrictMode>

);
